{"version":3,"sources":["../../../../src/client/dev/dev-build-indicator/initialize-for-app-router.ts"],"sourcesContent":["import { devBuildIndicator } from './internal/dev-build-indicator'

/** Integrates the generic dev build indicator with the App Router. */
export const initializeDevBuildIndicatorForAppRouter = () => {
  if (!process.env.__NEXT_DEV_INDICATOR) {
    return
  }

  devBuildIndicator.initialize()
}
